swaptrade_modal_desc_crosschain_valuedif:
Las comisiones que se consideran en la diferencia en el valor de este swap cross-chain son las siguientes:
• Comisión del bridge cross-chain: {bridgePriceAndFee} 
• Comisión de red en la cadena de destino: {toChainPriceAndFee}
• Cuando haces trading de una cierta cantidad de tokens, esto afecta la profundidad del pool de liquidez. Esto, a su vez, cambia la disponibilidad general y el precio de los tokens, lo que ocasiona diferencias notables en los precios.

swaptrade_mid_dialog_desc_est_network_fe:
En las transacciones cross-chain, esta comisión incluye las comisiones de red de la cadena del token de pago y el bridge cross-chain.

La comisión de esta transacción se muestra como:
· {chain} Comisión de red de la cadena: {value1}
· {bridge} Comisión de red del bridge: {value2}

Las comisiones de red se pagan a los mineros y no se cobra en nuestra plataforma.

swaptrade_intro_dialog_desc_cross_value_:
La diferencia en el valor de esta transacción se muestra de la siguiente manera:
· Comisión de red de la cadena {chain}: {value1}
· Comisión del bridge {bridge}: {value2}

Si la diferencia en el valor es mucho mayor pero las comisiones que figuran arriba son relativamente pequeñas, se debe a que el monto del swap afectó la profundidad del pool de liquidez de este par de tokens.

swaptrade_intro_tooltip_trade_including_:
En los swaps cross-chain, el costo incluye la comisión de red de la red de pago y una parte de las comisiones del bridge cross-chain. Desglose de comisiones de esta transacción:
• Comisión de red: {fromChainPriceAndFee}
• Comisión de bridge cross-chain: {bridgePriceAndFee}
La comisión de red se utiliza para cubrir los costos de los mineros y no la cobra nuestra plataforma.

